            cell_hover_color: "gray-50",
            cell_focus_color: "gray-200",
            cells: ["restless", "good", "great", "0-4h", "5-7h", "8-9h", "10-11h"]
        }]
    }

    return (
        <div className="mx-8 lg:mx-32">
            <Header name={"Marianna"}/>
            <div className="flex justify-between">
                {inputs.categories.map(cat => <Category name={cat.name} bg={cat.bg_color} />)}
            </div>

        </div>
    )
}

export default HomePage
